const SinglePost = (props) => {

    const { indivPosts, idx } = props

    return (
        <div key={idx}>
            <p> - {indivPosts.title} - </p>
            <p>{indivPosts.author.username}</p>
            <p>{indivPosts.location}</p>
        </div>

    )

};


export default SinglePost;
